import {
  Checkbox,
  Container,
  FormControlLabel,
  FormGroup,
  Stack,
  Typography,
  Alert,
} from "@mui/material";

export default function KYsheetDetails() {
  const handleSubmit = (e) => {
    console.log(e.target.value);
  };
  return (
    <Container maxWidth="95%">
      <Stack spacing={2}>
        <Stack spacing={2} direction="row" alignItems="center">
          <Typography
            sx={{
              width: "20px",
              height: "20px",
              borderRadius: "50%",
              border: "2px solid blue",
              textAlign: "center",
            }}
          >
            1
          </Typography>
          <Typography sx={{ fontWeight: 700, fontSize: "14px" }}>
            KY Sheet Details
          </Typography>
        </Stack>
        <Typography sx={{ fontWeight: 700, fontSize: "10px" }}>
          Please Check if the following items is applicable
        </Typography>
        <Stack>
          <FormGroup onSubmit={handleSubmit} spacing="dense">
            <FormControlLabel
              control={<Checkbox />}
              label={
                <Typography sx={{ fontWeight: 700, fontSize: "10px" }}>
                  Please Check if the following items is applicable
                </Typography>
              }
            />
            <FormControlLabel control={<Checkbox />} label="Required" />
            <FormControlLabel control={<Checkbox />} label="Disabled" />
          </FormGroup>
        </Stack>
        <Alert severity="warning">Hello world</Alert>
      </Stack>
    </Container>
  );
}
